import React from 'react';
import './style.scss';

class Services extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="row">
                <div className="col-lg-4 col-md-4 col-sm-4 wow fadeInUp" data-wow-delay="0.6s">
                    <i className="icon-cloud medium-icon"></i>
                    <h3>WEB MARKETING</h3>
                </div>
                <div className="col-lg-4 col-md-4 col-sm-4 wow fadeInUp" data-wow-delay="0.9s">
                    <i className="icon-mobile medium-icon"></i>
                    <h3>UI &amp; UX DESIGN</h3>
                </div>
            </div>
        )
    }
}

export default Services;
